    const{trainee} = props.ExamResult

    useEffect(() => {
        loadExams()
    }, [])

    const loadExams = () => {
        axios.get(api)
                .then(response => {setExamList(response.data)})
                .catch(error => console.log('unable to load data'))
    }

    return(
        <div>
            {
                examList.map(
                    examResults => <ExamCard key={trainee.id} examResults={examResults}/>
                )
            }
           
        </div>
    )
}

